Palcoin_ProductManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

contract Palcoin_ProductManager{
    mapping(address => bool) IsOwner;

    struct Debt_package{
        string Name;
        uint256 MaxDebtRatio; // * 10 ** 4
        uint256 MaxInitDebtRatio;   // * 10 ** 4
        uint256 MinDebtFloor;
        uint256 MaxDebtCeil;
        uint256 LiquidationPanalty; // * 10 ** 4
        uint256 InterestRate;       // * 10 ** 4
        uint256 LiquidationRatio;   // * 10 ** 4
        uint MinDuration;
    }
    Debt_package[] public Product;
    
    constructor(address MsgSender) payable {
        //Our First Debt Package
        Debt_package memory First_Product = Debt_package({
            Name : "ChipiChipi",
            MaxDebtRatio : 8000,           // 0.8
            MaxInitDebtRatio : 7500,       // 0.75
            MinDebtFloor : 1 * 10 ** 18,
            MaxDebtCeil : 100000000 * 10 *18,
            LiquidationPanalty : 1500,     // 0.15
            InterestRate : 1000,           // 0.1
            LiquidationRatio : 2500,       // 0.25
            MinDuration : 10               // 10 day
        });
        Product.push(First_Product);
        IsOwner[MsgSender] = true;
        IsOwner[msg.sender] = true;
    }

    // DebtPackageShow show Debt Product[index] 
    function DebtPackageShow(uint index) public view returns(Debt_package memory){
        require(index < Product.length, "Index out of bounds");
        return Product[index];
    }

}

